      const charts = {};
      const CHART_COLORS = [
          '#4E79A7', '#F28E2B', '#E15759', '#76B7B2', '#59A14F',
          '#EDC948', '#B07AA1', '#FF9DA7', '#9C755F', '#BAB0AC'
      ];

      function formatTime(seconds) {
        if (seconds === null || seconds === undefined) return '';
        const mins = Math.floor(seconds / 60);
        const secs = (seconds % 60).toFixed(2);
        return `${mins}:${secs.padStart(5, '0')}`;
      }

      function updateChart() {
        const activeTab = document.querySelector('.tab-btn.active').innerText;
        const chart = charts[activeTab];
        
        const selectedAthletes = Array.from(document.querySelectorAll('input[name="athlete"]:checked')).map(cb => cb.value);
        
        chart.data.datasets = [];
        selectedAthletes.forEach((athleteName, index) => {
          const athleteData = ALL_DATA[activeTab][athleteName];
          if (athleteData) {
            chart.data.datasets.push({
              label: athleteName,
              data: athleteData,
              borderColor: CHART_COLORS[index % CHART_COLORS.length],
              fill: false,
              tension: 0.1
            });
          }
        });
        chart.update();
      }

      function openTab(evt, tabName) {
        document.querySelectorAll('.tab-pane').forEach(p => p.classList.remove('active'));
        document.querySelectorAll('.tab-btn').forEach(b => b.classList.remove('active'));
        document.getElementById(tabName).classList.add('active');
        evt.currentTarget.classList.add('active');
        updateChart();
      }

      document.addEventListener('DOMContentLoaded', () => {
        document.querySelectorAll('.tab-pane').forEach(pane => {
            const groupName = pane.id;
            const ctx = pane.querySelector('canvas').getContext('2d');
            charts[groupName] = new Chart(ctx, {
                type: 'line',
                data: { datasets: [] },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    scales: {
                        x: {
                            type: 'time',
                            time: {
                                unit: 'year',
                                tooltipFormat: 'MMM d, yyyy',
                                displayFormats: { year: "'Year' Q" }
                            },
                            ticks: {
                                callback: function(value, index, ticks) {
                                    const year = new Date(value).getFullYear();
                                    return `Year ${year - 2000}`;
                                }
                            },
                            title: { display: true, text: 'High School Year' }
                        },
                        y: {
                            title: { display: true, text: 'Performance (Time)' },
                            ticks: { callback: value => formatTime(value) }
                        }
                    },
                    plugins: {
                        tooltip: {
                            callbacks: {
                                label: context => `${context.dataset.label}: ${formatTime(context.parsed.y)}`
                            }
                        }
                    }
                }
            });
        });
        updateChart();
      });
    </script>
